import styled from 'styled-components';

const Font = styled.div`
  position: absolute;
  z-index: 1000;
  display: flex;
  align-items: center;
  justify-content: center;
  cursor: pointer;
`;

export default function FontElement({ id, content, onClick, style }) {
  return (
    <Font
      key={id}
      id={id}
      style={style}
      onClick={onClick}
      // onClick={() => {
